import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <div className="sidebar-item">
                <img src="/icons/home-icon.png" alt="Home" />
            </div>
            <div className="sidebar-item">
                <img src="/icons/inbox-icon.png" alt="Inbox" />
            </div>
            <div className="sidebar-item">
                <img src="/icons/sent-icon.png" alt="Sent" />
            </div>
            <div className="sidebar-item">
                <img src="/icons/drafts-icon.png" alt="Drafts" />
            </div>
            <div className="sidebar-item">
                <img src="/icons/trash-icon.png" alt="Trash" />
            </div>
            {/* Add more icons as necessary */}
        </div>
    );
};

export default Sidebar;
